import React, {useState} from 'react';

export default function CounterHooks({initialcount}){
    const [count, setCount] = useState(initialcount);
    return <>
        <button onClick={() => setCount(prevCount => prevCount-1)}>-</button>
        <span>{}</span>
        <button onClick={() => setCount(prevCount => prevCount + 1)}>+</button>
    </>
}
